parseXML <- function(data,filePath){
  # Parse the XML from string
  doc <- xmlParse(data)
  # Extract sequence elements
  sequences <- getNodeSet(doc, "//sequence")
  
  # Initialize a list to store species and their sequences
  sequence_data <- list()
  d<-data.frame(species=character(), missingChars=numeric())
  
  # Extract attributes from each sequence element
  for (seq in sequences) {
    species_name <- xmlGetAttr(seq, "taxon")
    sequence_value <- xmlGetAttr(seq, "value")
    
    # Remove the 'seq_' prefix from species name
    species_name <- sub("seq_", "", species_name)
    species_name <- sub("_first|_last", "", species_name)
    species_name <- sub("_", " ", species_name)
    l <- nchar(xmlGetAttr(seq, "value"))
    percentage <- round((str_count(sequence_value, "\\?|N|n|-")/l)*100,2)
    
    d<- rbind(d, data.frame(species=species_name, missingChars=percentage))
    if (sum(d$species==species_name)>1){ # our data has non empty sequences attached only to one end of strat range. Remove the end that has all empty chars
      d <- d[-which(d$species==species_name & d$missingChars>=100),]
    }
  }
  write.csv(d, filePath)
}


